components:
  schemas:
    tmp0:
      properties:
        A: {type: string}
        AAAA: {type: string}
        CERT: {type: string}
        CNAME: {type: string}
        DNAME: {type: string}
        MX: {type: string}
        NS: {type: string}
        PTR: {type: string}
        RP: {type: string}
        SOA: {type: string}
        SPF: {type: string}
        SRV: {type: string}
        TXT: {type: string}
        URI: {type: string}
      type: object
  securitySchemes: {}
info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of Swimlane DNS
  title: Swimlane DNS
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Swimlane DNS Retrieve DNS records
      parameters:
      - description: Domain to look up DNS records
        example: swimlane.com
        in: query
        name: Domain
        required: true
        schema: {type: string}
      - description: 'A CSV of DNS records that you want to return. Default DNS records
          are: TXT, CNAME, SOA, NS, MX, CERT, DNAME, PTR, A, AAAA, SPF, SRV, URL'
        example: TXT,CNAME,NS,MX,A,AAAA,SPF
        in: query
        name: Records
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Swimlane DNS Get DNS Records
tags:
- {name: Miscellaneous}
